import React from 'react';
import '../css/news.css';

const News = () => (
  <div className='news'>
      <div className='text'>
        <p>Организатор</p>
        <p>Название турнира</p>
        <p>Карта</p>
        <p>Дата</p>
      </div>
    <div className='image'>

    </div>
  </div>
);

export default News;
